> Political Clinton meets face-to-face with Benghazi committee Democratic presidential candidate, former Secretary of State Hillary Rodham Clinton arrives on Capitol Hill in Washington, Thursday, Oct. 22, 2015, to testify before the House Benghazi Committee. After months of buildup, Hillary Rodham Clinton finally takes center stage as the star witness in the Republican-led investigation into the deadly 2012 attacks in Benghazi, Libya. (AP Photo/Manuel Balce Ceneta) 
